(899390125, 530568206, 530568206, 1, 1450137872, 'Message pour T5UN4M1', 'casse toi petit con'),
(1423396745, 0, 530568206, 9, 1450138244, 'Un joueur que vous avez signalé a été banni', '<span class="good">Un joueur que vous avez signalé a été banni.Merci de nous avoir aidé à éliminer les mauvais joueurs!</span>'),
(558563710, 0, 530568206, 2, 1450136715, 'Transport de ressources', 'Votre flotte partie de <a href="?a=galaxy&g=1&s=1">1:1:4</a> a atteint votre autre planète <a href="?a=galaxy&g=1&s=1">1:1:6</a> avec comme mission : Transporter.<br /> Elle transportait les ressources suivantes : <br />acier : <span class=''res0''>500</span>'),
(1103416274, 0, 530568206, 2, 1450137519, 'Retour', 'Votre flotte revient sur <a href="?a=galaxy&g=1&s=1">1:1:4</a> après etre parti en <a href="?a=galaxy&g=1&s=1">1:1:6</a> avec comme mission : Transporter.<br />Chasseur lourd : 50<br />Cuirassé : 5.000'),
(374620506, 0, 530568206, 2, 1450136073, 'Espionnage', '<table><tr><th colspan="5">Rapport d''espionnage de la planete <a href="?a=galaxy&g=1&s=1">1:1:7</a></th></tr><tr><th colspan="5">Ressources</th></tr><tr><td>acier: <span class=''res0''>1.426</span></td><td>silicium: <span class=''res1''>1.176</span></td><td>hydrogène: <span class=''res2''>100</span></td></tr><tr><th colspan="5">Batiments</th></tr><tr><th colspan="5">Vaisseaux</th></tr><tr><td>Petit transporteur: 1</td></tr><tr><th colspan="5">Défenses</th></tr><tr><th colspan="5">Recherches</th></tr></table>'),
(792283081, 0, 530568206, 2, 1450135749, 'Retour', 'Votre flotte revient sur <a href="?a=galaxy&g=1&s=1">1:1:4</a> après etre parti en <a href="?a=galaxy&g=1&s=5">1:5:7</a> avec comme mission : Attaquer.<br />acier : <span class=''res0''>312.620.435</span><br />silicium : <span class=''res1''>14.485.397</span><br />hydrogène : <span class=''res2''>294.717.507</span><br />Croiseur : 3<br />Cuirassé : 5.000'),
(1589093050, 0, 530568206, 2, 1450136000, 'Rapport de combat (Défaite)', 'Une flotte ennemie partie de <a href="?a=galaxy&g=1&s=1">1:1:4</a> a livré battaille chez vous en <a href="?a=galaxy&g=1&s=5">1:5:7</a>.<br /><span class="bad"><a href="?a=rc&id=1926162749&key=3f2a6f9a028310492a5eb0ecc3b66a9fa5ddcc4c">\r\n                        Rapport (Pertes attaquant : 1.050.000 Pertes défenseur : 1.020.695.750)</a></span>'),
(325549164, 0, 1954841905, 2, 1450127725, 'Espionnage hostile détecté', 'Une flotte partie de 1:1:4 a été aperçue près de votre planète en 1:6:6 en train de l''espionner.'),
